from PIL import Image


def array_to_color_image(arr, value_to_color, default_color=(0, 0, 0)):
    """
    把二维 NumPy 数组 arr 转为 RGB 图像。
    value_to_color: 字典 { 数值 -> (R,G,B) }
    default_color: 其他数值使用的颜色
    """
    # 确保 arr 是整数类型或至少能做索引判断
    h, w = arr.shape
    # 创建一个 RGB 图像数组
    img = np.zeros((h, w, 3), dtype=np.uint8)
    for val, color in value_to_color.items():
        mask = (arr == val)
        img[mask] = color
    mask_default = ~np.isin(arr, list(value_to_color.keys()))
    img[mask_default] = default_color

    return Image.fromarray(img, mode='RGB')

